import React from 'react';
import Service from "../../repository/Repository";
import {useLocation} from "react-router-dom";

const SearchResultBook = ({ data }) => {
    const location=useLocation()
    const mydata=location.state
    const onFormSubmit =async (e) => {
        e.preventDefault();
        console.log(mydata)
    }
    return (
        <div style={{maxWidth: '800px', margin: '0 auto', padding: '40px', backgroundColor: '#f8f8f8', borderRadius: '10px', boxShadow: '0 0 10px rgba(0, 0, 0, 0.2)'}}>
            <h2 style={{fontSize: '40px', fontWeight: 'bold', marginBottom: '20px', color: '#212121'}}>{data.label}</h2>
            <p style={{fontSize: '20px', lineHeight: '1.5', color: '#212121', marginTop: '0', marginBottom: '20px'}}>Country: <span style={{ color: '#0f9d58' }}>{data.country}</span></p>
            <p style={{fontSize: '20px', lineHeight: '1.5', color: '#212121', marginTop: '0', marginBottom: '20px'}}>Release Date: <span style={{ color: '#0f9d58' }}>{data.releaseDate}</span></p>
            <p style={{fontSize: '20px', lineHeight: '1.5', color: '#212121', marginTop: '0', marginBottom: '20px'}}>Language: <span style={{ color: '#0f9d58' }}>{data.language}</span></p>
            <p style={{fontSize: '20px', lineHeight: '1.5', color: '#212121', marginTop: '0', marginBottom: '0'}}>Abstract: <span style={{ color: '#555' }}>{data.abstract}</span></p>
        </div>
    );
};

export default SearchResultBook;
